function logOut(){$.ajax({url:"https://api.startapped.com/v1/account/logout",headers:{"Content-Type":"application/json",Authorization_Access:getCredentials().access,Authorization_Refresh:getCredentials().refresh},method:"POST",dataType:"json",success:function(e){removeCredentials(),window.location.replace("/")},error:function(e,t,o){showSnackbar(JSON.parse(e.responseText).message)}})}